import React, { useEffect } from 'react'
import ReactHlsPlayer from 'react-hls-player';
import { connect } from "react-redux";
import ApiRequest from '../../services/api/Api-request';
export const Video = (props) => {
    let url;
    useEffect(() => {
        const params = new URLSearchParams();
        params.append("token", props.state.token);
        params.append("device", "Web");
        params.append("id", props.match.params.id);
        url = props.player(params); 
    }, [])

    return (
        <div>
            <ReactHlsPlayer
            url={url}
            autoplay={true}
            controls={true}
            width={500}
            height={375}/>
        </div>
    )
}
const mapStateToProps = (state) => ({ state: state });

const mapDispatchToProps = (dispatch) => ({
    player: (params) => {
    ApiRequest.Peine.Player(params)(dispatch);
  },
});

const connectedVideo = connect(
  mapStateToProps,
  mapDispatchToProps
)(Video);

export default connectedVideo;
